data Precos =
	 Precos {  fipe_marcaP  :: String
			  ,referenciaP  :: String
			  ,fipe_codigoP :: String
			  ,nameP        :: String
			  ,marcaP       :: String
			  ,precoP       :: String
			  ,keyP         :: String
			  ,timeP        :: Float  
			  ,idP          :: String
			 }deriving Show
	
instance FromJSON Precos where 
	parseJSON (Object p) =
		  Precos <$> p .: "fipe_marca" 
				 <*> p .: "referencia" 
				 <*> p .: "fipe_codigo"
				 <*> p .: "name"       
				 <*> p .: "marca"
				 <*> p .: "preco"
				 <*> p .: "key"
				 <*> p .: "time"         
				 <*> p .: "id"         
				        
	parseJSON _= mzero 

getJSONPrecos :: Int -> String -> String -> IO B.ByteString
getJSONPrecos idMarca idVeiculo ano = simpleHttp $ "http://fipeapi.appspot.com/api/1/carros/veiculo/"++(show idMarca)++"/"++idVeiculo ++"/"++ano++".json"

precoVazio :: Precos
precoVazio = Precos {fipe_marcaP = "vazio", referenciaP = "", fipe_codigoP = "", nameP = "", marcaP = "", precoP = "", keyP = "", timeP = 0.0, idP = ""}

getPreco :: Int -> String -> String-> IO (Maybe Precos)
getPreco idMarca idVeiculo ano = fmap decode $ simpleHttp $ "http://fipeapi.appspot.com/api/1/carros/veiculo/"++(show idMarca)++"/"++idVeiculo ++"/"++ano++".json"

