primeiro :: (a,b,c) -> a
primeiro (a,b,c) = a

segundo  :: (a,b,c) -> b
segundo (a,b,c) = b

terceiro :: (a,b,c) -> c
terceiro (a,b,c) = c

tripla :: [[Int]] -> [[String]] -> [String] -> [[(Int, String, String)]]
tripla  [] _ _ = []
tripla  _ _ [] = []
tripla  _ [] _ = []
tripla (idm:is) (lsv:vs) (ano:as) = (L.zip3 idm lsv (L.replicate (L.length lsv) ano)):tripla is vs as

geraListaIdMarcas :: [Int] -> [[String]] -> [[Int]]
geraListaIdMarcas [] _ = []
geraListaIdMarcas _ [] = []
geraListaIdMarcas (li:idms) (lv:vs) = (L.replicate (L.length lv) li):geraListaIdMarcas idms vs 

unicos :: Eq a => [a] -> [a]
unicos [] = []
unicos (x:xs)
    | elem x  xs =  x : (unicos $ delete x xs)
    | otherwise = x : unicos xs

delete :: Eq a => a -> [a] -> [a]
delete deleted xs = [ x | x <- xs, x /= deleted ]

